module accu (
    input clk,
    input rst_n,
    input [7:0] data_in,
    input valid_in,
    output reg valid_out,
    output reg [9:0] data_out
);

reg [31:0] accumulator;
reg [2:0] count;

always @(posedge clk or negedge rst_n) begin
    if (!rst_n) begin
        accumulator <= 32'b0;
        count <= 3'b0;
        valid_out <= 1'b0;
        data_out <= 10'b0;
    end else begin
        if (valid_in) begin
            accumulator <= accumulator + data_in;
            count <= count + 1;
        end

        if (count == 3'b111) begin
            data_out <= accumulator[9:0];
            valid_out <= 1'b1;
            count <= 3'b000;
        end else begin
            valid_out <= 1'b0;
        end
    end
end

endmodule

